INSERT INTO `blog` (`id`, `titre`, `url`, `texte`, `image`, `auteur`, `categorie`, `date`, `etat`) VALUES
(1, 'Du nouveau dans l''équipe Swaps', '', 'C''est avec beaucoup de joie que nous vous annonçons l''arrivée de deux nouveaux membres dans l''équipe Swaps.\r\nJules Ecard s''occupera du développement front-end de la messagerie instantanée et Eulalie Garrigues aura pour but de conseiller sur la gestion du projet et d''apporter un regard externe.\r\nNous sommes donc à présent 4 dans cette équipe avec Florian et moi, Nathan.', 'blog1.jpg', 'N.CHEVALIER', 'Equipe', 'Le 17 Juin 2017 à 18 heures', 1),
(2, 'Participez à notre grand sondage', '', 'Depuis aujourd''hui, un sondage est disponible. Ce sondage nous permettra de déterminer vos impressions par rapport au positionnement du projet et nos engagements sur la protection de la vie privée. C''est la première étape du lancement du projet, alors n''hésitez pas à le propager largement autour de vous!', 'blog2.jpg', 'N.CHEVALIER', 'V. Alpha', 'Le 1er Juillet 2017 à 11h00', 1);
INSERT INTO `messages` (`id`, `email`, `sujet`, `nom`, `texte`, `date`, `etat`) VALUES
(3, 'corentin@jaimelesstartups.fr', 'Swaps sur j''aime les startups', 'corentin', '\nHello l''équipe,\n\nJe viens de découvrir votre camapgne de financement sur KissKissBankBank et si vous souhaitez que nous mettions en avant cette campagne sur notre site ( http://www.jaimelesstartups.fr ), il suffit que vous remplissier notre formulaire : \n\nhttp://www.jaimelesstartups.fr/ajouter-un-projet-financer/\n\nje reste à votre dispo pour toutes questions,\n\nCorentin', '2017-08-02 06:14:55', 1),
(4, 'oliver.killian70@gmail.fr', 'Bonjour Nathan, est toute l''équipe !', 'Killian Oliver', 'Hey Nathan ! c''est Killian, toute mes excuse... je me suis volatilisé du projet :/ mes études ont fait que je me suis complément deconnecté de l''ordinateur  :/ cependant je suit de trés prêt le projet qui semble avoir bien avancé ! le site posséde une beau design, grosse amélioration :D\nje repasse de temps en temps voir comment sa avance et si jamais tu a besoin d''avis n''hésite pas a me demander par mail: oliver.killian70@gmail.com\nEncore désolé de ne pas avoir pus t''aidé plus longtemps...\nbonne continuation a toi et ton équipe !', '2017-08-24 09:28:50', 1);
