(13, 2, 4, 2, 1, 3, 2, 1, 2, 2, 2, '', '', '', '', '', '2017-07-10 15:46:14', '83.194.68.41'),
(20, 2, 2, 3, 1, 2, 2, 1, 2, 2, 2, '', 'Des liens sociaux vont effectivement être créés, mais la majorité ne perdurerons pas; à moins que les services en question soient réguliers et qu''ils durent dans le temps.\nSi tu veux créer des liens sociaux avec Swaps, il faut donc privilégier ce type de lien.\n\nNathan Gautheron', '', 'Si tu veux développer Swaps, il faut traduire le site au moins en anglais. ( mais je suppose que tu y a déjà pensé, si ce n''est pas déjà fait ( j''ai pas trop regardé )).\n\nNathan Gautheron', 'surtout pas .io, ça fait passer Swaps pour un site de merde XD\n\nNathan Gautheron', '2017-07-10 17:49:33', '92.148.50.107'),
